import { Route ,Switch} from 'react-router-dom';
import Editcontact from './components/editcontact';
import Listcontact from './components/listcontacts';
import './App.css';
import Addcontact from './components/addcontact';

function App() {
  return (
    <div>
      <Switch>
      <Route exact to="/">
        <Listcontact/>
        </Route>
        <Route to="/newcontact">
        <Addcontact/>
        </Route>
        <Route to="/editcontact">
        <Editcontact/>
        </Route>
      </Switch>





    </div>
  );
}

export default App;
